        this.state = {
            zipData:[]
        }
    }

    getdata(e){
        e.preventDefault()
        const [zip,setState] = useState(this.state.zipData)
        setState = () =>{
        fetch(`http://ctp-zip-api.herokuapp.com/zip/10305`)
        .then(Response => Response.json())
        .then(data => console.log())   
        }
        
    }
    render(){
        return(
            <div>
                <input type = 'text'></input>
                <button onSubmit={this.getdata}>Submit</button>
            </div>
        )
    }
}
